import React, { useState } from "react";
import { Link } from "react-router-dom";
import "../styles/pages/culto-page.css";

import LogoSmall from "../images/logo-small.svg";

function CultoPage() {
  const [fullName, setFullName] = useState("Nome Completo");

  return (
    <div id="culto-page">
      <Link to="/" className="logo">
        <img src={LogoSmall} alt="InÃ­cio" />
      </Link>
      <main>
        <h2>Culto de Domingo</h2>
        <input
          type="text"
          value={fullName}
          onChange={(event) => setFullName(event.target.value)}
        //   onClick={(event) => setFullName("")}
        />
        <input type="text" value="Telefone" />
        <Link
          to="/culto"
          onClick={() => console.log("Click!")}
          className="confirm"
        >
          Inscrever-se
        </Link>
        <Link to="/" className="cancel">
          Voltar
        </Link>
      </main>
    </div>
  );
}

export default CultoPage;
